package com.uni.spring.car.model.dto;

public class ReserveCar {
	
	private int reserveNo;
	private String reserveDate;
	private String reserveCarNo;
	private String reserveMNo;
	private String useDate;
	private String useNote;
	private int cNo;
	
	public ReserveCar() {
		// TODO Auto-generated constructor stub
	}

	public int getReserveNo() {
		return reserveNo;
	}

	public void setReserveNo(int reserveNo) {
		this.reserveNo = reserveNo;
	}

	public String getReserveDate() {
		return reserveDate;
	}

	public void setReserveDate(String reserveDate) {
		this.reserveDate = reserveDate;
	}

	public String getReserveCarNo() {
		return reserveCarNo;
	}

	public void setReserveCarNo(String reserveCarNo) {
		this.reserveCarNo = reserveCarNo;
	}

	public String getReserveMNo() {
		return reserveMNo;
	}

	public void setReserveMNo(String reserveMNo) {
		this.reserveMNo = reserveMNo;
	}

	public String getUseDate() {
		return useDate;
	}

	public void setUseDate(String useDate) {
		this.useDate = useDate;
	}

	public String getUseNote() {
		return useNote;
	}

	public void setUseNote(String useNote) {
		this.useNote = useNote;
	}

	public int getcNo() {
		return cNo;
	}

	public void setcNo(int cNo) {
		this.cNo = cNo;
	}

	
	
}
